drop table drug;
create table drug (
	id INT,
	drug_name VARCHAR(50),
	ingredient VARCHAR(50),
	order_datetime DATE,
	drug_company VARCHAR(50),
	dose INT,
	unit VARCHAR(3),
	patient_id INT,
	visit_id INT,
	PRIMARY KEY(id),
	CONSTRAINT fk_patient
	FOREIGN KEY(patient_id) 
	  REFERENCES patient(id),
	  CONSTRAINT fk_visit
	FOREIGN KEY(visit_id) 
	  REFERENCES visit(id)
);
COMMENT ON TABLE drug IS 'Contains medication related order entries, i.e. prescriptions.';
COMMENT ON COLUMN drug.id IS 'Identifier for a single prescription in the database.';
COMMENT ON COLUMN drug.drug_name IS 'drug_name column represents the drug prescribed to the patient.';
COMMENT ON COLUMN drug.ingredient IS 'ingredient is the drug substance itself, and excipients, which are the ingredients of the tablet, or the liquid in which the active agent is suspended, or other material that is pharmaceutically inert.';
COMMENT ON COLUMN drug.order_datetime IS 'order_datetime specify the date for which the prescription was valid.';
COMMENT ON COLUMN drug.drug_company IS 'Medications listed for each manufacturer or distributor may also be marketed under different names in other countries.';
COMMENT ON COLUMN drug.dose IS 'The dose is the amount of drug taken at any one time.';
COMMENT ON COLUMN drug.unit IS 'unit specifies the dosage used for the drug_name';
COMMENT ON COLUMN drug.patient_id IS 'patient_id is a unique identifier which specifies an individual patient.';
COMMENT ON COLUMN drug.visit_id IS 'visit_id represents a single patientâ€™s admission to the hospital.';

